import pickle

HEX = ''


def main():
    _it = iter(HEX)
    hex_list = []
    while 1:
        ch1 = next(_it, None)
        if ch1 == None:
            break

        ch2 = next(_it)
        ch = int(f'{ch1}{ch2}', 16)
        print(ch)
        hex_list.append(ch)

    ret = pickle.loads(bytes(hex_list))
    print(ret)


if __name__ == '__main__':
    main()